import './App.css';
import Header from './components/Header';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import bgImage from './assets/Solar_background.jpg';


function App() {
  const style = {
    width: '100%',
    height: '1000px',
    backgroundImage: `url(${bgImage})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',display: 'flex', flexDirection: 'column', minHeight: '100vh'
  };
  return (
    <div style={style}>
      <main style={{ flex: 1 }}>
      <Navbar />
      <Header />
      <p>This is the homepage.</p>
      </main>
      <Footer />
    </div>
  );
}

export default App;
